import React, { Component } from 'react'
import { connect } from 'react-redux'


class Home extends Component {
  render() {
    return (
      <div>
        HOME
      </div>
    )
  }
}

const mapStateToProps=(state)=>{
    return{
        items:state.items
    }
  }

  export default connect (mapStateToProps)(Home)
